pub fn select_palette<S>(name: S, invert: bool) -> Vec<Rgba> where S: Into<String>, {

	let chosen_palette = palette(name);

  let mut red = set_palette(&chosen_palette, Red);
  let mut green = set_palette(&chosen_palette, Green);
  let mut blue = set_palette(&chosen_palette, Blue);

	if invert {
	  red.reverse();
	  green.reverse();
	  blue.reverse();
	}
	
	(0..red.len()).into_iter().map(|i| Rgba{r:red[i], g:green[i], b:blue[i], a:255}).collect()

}

